import React from "react";
import { Navbar, Row, Col } from "react-bootstrap";

const Footer = () => {
  return (
    <Navbar sticky="bottom" className="bg-light">
      <Row>
        <Col lg={3} style={{ width: "30%" }}>
          <h5>Company</h5>
        </Col>
        <Col lg={3}>
          <h5>Resources</h5>
        </Col>
        <Col lg={3}>
          <h5>Search</h5>
        </Col>
      </Row>
    </Navbar>
  );
};

export default Footer;
